import React, { useEffect, useState } from "react";
import { Card, Stat } from "../../components/UI";
import { NavLink } from "react-router-dom";

function TrainerDashboard({ auth }) {
  const [clients, setClients] = useState([]);
  const [workoutsCount, setWorkoutsCount] = useState(0);
  const [dietsCount, setDietsCount] = useState(0);

  useEffect(() => {
    const users = JSON.parse(localStorage.getItem("users") || "[]");
    const myClients = users.filter(u => (auth.clients || []).includes(u.id));
    setClients(myClients);

    const workouts = JSON.parse(localStorage.getItem("workouts") || "[]").filter(w => myClients.map(c => c.id).includes(w.userId));
    setWorkoutsCount(workouts.length);

    const diets = JSON.parse(localStorage.getItem("diets") || "[]").filter(d => myClients.map(c => c.id).includes(d.userId));
    setDietsCount(diets.length);
  }, [auth.clients]);

  return (
    <div className="container">
      <h2>Welcome, {auth.name}</h2>
      <div className="row" style={{ marginTop: 12 }}>
        <div className="col"><Stat label="Clients" value={(auth.clients || []).length} /></div>
        <div className="col"><Stat label="Assigned Workouts" value={workoutsCount} /></div>
        <div className="col"><Stat label="Diet Plans" value={dietsCount} /></div>
      </div>
      <div className="row" style={{ marginTop: 12 }}>
        <div className="col">
          <Card title="Quick actions">
            <div style={{ display: "flex", gap: 8, flexWrap: "wrap" }}>
              <NavLink to="/trainer/workouts"><button>Create Workouts</button></NavLink>
              <NavLink to="/trainer/diets"><button>Create Diet Plans</button></NavLink>
              <NavLink to="/trainer/progress"><button>View Progress</button></NavLink>
              <NavLink to="/trainer/bmi"><button>View BMI Reports</button></NavLink>
              <NavLink to="/trainer/profile"><button>Manage Clients</button></NavLink>
            </div>
          </Card>
          <Card title="My clients">
            <div className="list">
              {clients.map(c => (
                <div className="list-item" key={c.id}>
                  <div><strong>{c.name}</strong> <span className="helper">({c.email})</span></div>
                  <div className="helper">Height {c.height || "—"} cm • Weight {c.weight || "—"} kg</div>
                </div>
              ))}
              {!clients.length && <div style={{ padding: 12 }}>No clients mapped. Use Profile → Manage Clients to add.</div>}
            </div>
          </Card>
        </div>
      </div>
    </div>
  );
}

export default TrainerDashboard;
